// src/components/Dashboard/TutorDashboard.js
import React from 'react';
import './TutorDashboard.css'; // Import the CSS for this component

const TutorDashboard = () => {
  return (
    <div className="tutor-dashboard">
      <h1>Tutor Dashboard</h1>
      <div className="dashboard-content">
        <div className="card">
          <h3>My Courses</h3>
          <p>3</p>
        </div>
        <div className="card">
          <h3>Pending Assignments</h3>
          <p>4</p>
        </div>
        <div className="card">
          <h3>Students Enrolled</h3>
          <p>25</p>
        </div>
        <div className="card">
          <h3>Upcoming Reviews</h3>
          <p>1</p>
        </div>
      </div>
    </div>
  );
};

export default TutorDashboard;
